    <div
      style={{
      marginTop: '180px'
    }}
      className="flex flex-col items center">
      <TextInput
        onChange={(e) => {
        setTextBoxState({
          ...textBoxState,
          text: e.target.value
        })
      }}
        value={textBoxState.text}
        placeholder='Write something...'/>
      <KarameBox style={{
          background: bgColor.hex,
          color: color.hex
        }} className='w-full mt-8'>
        <span
          className='w-full'
          style={{
          wordWrap: 'break-word',
          fontSize: `${textBoxState.fontSize}px`
        }}>{textBoxState.text}</span>
        <div
          style={{
          borderTop: '1px solid #D1D6DD'
        }}
          className="absolute py-4 px-6 flex items-center w-full bg-white left-0 bottom-0">
          <p  style={{
            color: '#000'
          }} className='mb-0 mr-4'>Size:</p>
          <SettingsInput
          style={{
            color: '#000'
          }}
            value={textBoxState.fontSize}
            type='number'
            onChange={(e) => {
            setTextBoxState({
              ...textBoxState,
              fontSize: e.target.value
            })
          }}/>
          <p  style={{
            color: '#000'
          }} className='mb-0 ml-4'>Color:</p>
          <ColorBox
            className='ml-4'
            style={{
            backgroundColor: color.hex
          }}>
            <div className="picker-wrap">
              <ColorPicker width={200} height={200} color={color} onChange={setColor}
              hideHEX hideRGB hideHSV/>
            </div>
          </ColorBox>
          <p  style={{
            color: '#000'
          }} className='mb-0 ml-4'>Background color:</p>
          <ColorBox
            className='ml-4'
            style={{
            backgroundColor: bgColor.hex
          }}>
            <div className="picker-wrap">
              <ColorPicker width={200} height={200} color={bgColor} onChange={setBgColor}
              hideHEX hideRGB hideHSV/>
            </div>
          </ColorBox>
        </div>
      </KarameBox>
    </div>
